import Navbar from "./Navisivut/Navbar";
import Varaus_lomake from "./Navisivut/Varaus_lomake";
import Footer from "./comps/Footer";
import Muut from "./Navisivut/Muut";
import Kirjautuminen from "./Navisivut/Kirjautuminen";
